import React from "react";
import {
  StyleSheet,
  View,
  Text,
  Button,
  TouchableOpacity,
  TextInput,
  Image
} from "react-native";

export default function Register({ navigation }) {
  const characters =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

  const generateString = (length) => {
    let result = " ";
    const charactersLength = characters.length;
    for (let i = 0; i < length; i++) {
      result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }

    return result;
  };

  const onsubmithandler = () => {
    console.log(generateString(10));
    return;
  };

  return (
    <View style={styles.container}>
      <View style={styles.container1}></View>
      <View style={styles.container2}>
        <Text style={styles.container21}>Payment</Text>
      </View>
      <View style={styles.container3}>
        <View style={styles.container31}>
          <Text style={styles.container31text}>Pay Now</Text>
        </View>

        <View style={styles.container33}>
          <Text style={styles.container33text}>Details</Text>
        </View>
        <View style={styles.container34}>
          <Text style={styles.container34text1}>Order Id: 1234</Text>
          <Text style={styles.container34text1}>Total: 1234</Text>
        </View>
        <View style={styles.container35}>
          <Text style={styles.container33text}>Card Details</Text>
          <TextInput placeholder="ENTER CARD NO." />
          <TextInput placeholder="CARD HOLDER NAME" />
          <TextInput placeholder="ENTER EXPIRE DATE " />
          <TextInput placeholder="ENTER CVV NO " />
          <Image
            style={styles.footerimagestyle}
            source={require("../assets/mastercard-logo.png")}
          />
          <Image
            style={styles.footerimagestyle}
            source={require("../assets/visa.png")}
          />
        </View>

        <TouchableOpacity color="#F57503" onPress={onsubmithandler}>
          <Text>PAY 2022</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column",
    justifyContent: "flex-start",
    backgroundColor: "#ffffff",
  },
  container1: {
    width: "100%",
    height: 68,
    backgroundColor: "#ffffff",
    // borderWidth:2,
    // borderColor:'black',
    // borderStyle:'solid',
  },
  container2: {
    width: "100%",
    height: 56,
    paddingLeft: 25,
    paddingTop: 17,
    backgroundColor: "#F57503",
    marginBottom: 30,
    // borderWidth:2,
    // borderColor:'black',
    // borderStyle:'solid',
  },
  container21: {
    fontSize: 16,
    fontWeight: "bold",
    color: "white",
  },
  container3: {
    marginLeft: 25,
    marginRight: 25,
  },
  container31text: {
    fontSize: 14,
    fontWeight: "bold",
    color: "#107B05",
  },
  container32: {
    marginTop: 15,
  },
  container32text: {
    color: "#474747",
    fontSize: 14,
  },
  container33: {
    marginTop: 25,
  },
  container34: {
    borderBottomWidth: 1,
    paddingBottom: 15,
    borderColor: "#979797",
  },
  container33text: {
    color: "#474747",
    fontSize: 14,
    fontWeight: "bold",
    marginBottom: 10,
  },
  container34text1: {
    fontSize: 12,
    fontWeight: "bold",
    color: "#474747",
    marginTop: 5,
  },
  container34text2: {
    marginTop: 5,
    fontSize: 10,
    // fontWeight:'bold',
    color: "#474747",
  },
  container341: {
    flexDirection: "row",
    width: 200,
    justifyContent: "space-between",
  },
  container35: {
    marginTop: 10,
    borderBottomWidth: 1,
    paddingBottom: 15,
    borderColor: "#979797",
  },
});
